package edu.school21.chat;import java.util.List;import java.util.Objects;public class User {    private Long id;    private String name;    private String password;    private List<Chatroom> createdRooms;    private List<Chatroom> activeRooms;    public User(Long id, String name, String password, List<Chatroom> createdRooms,                List<Chatroom> activeRooms) {        this.id = id;        this.name = name;        this.password = password;        this.createdRooms = createdRooms;        this.activeRooms = activeRooms;    }    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getPassword() {        return password;    }    public void setPassword(String password) {        this.password = password;    }    public List<Chatroom> getCreatedRooms() {        return createdRooms;    }    public void setCreatedRooms(List<Chatroom> createdRooms) {        this.createdRooms = createdRooms;    }    public List<Chatroom> getActiveRooms() {        return activeRooms;    }    public void setActiveRooms(List<Chatroom> activeRooms) {        this.activeRooms = activeRooms;    }    @Override    public boolean equals(Object o) {        if (this == o) return true;        if (!(o instanceof User user)) return false;        return Objects.equals(id, user.id) &&                Objects.equals(name, user.name) &&                Objects.equals(password, user.password) &&                Objects.equals(createdRooms, user.createdRooms) &&                Objects.equals(activeRooms, user.activeRooms);    }    @Override    public int hashCode() {        return Objects.hash(id, name, password, createdRooms, activeRooms);    }    @Override    public String toString() {        return "User " +                "id = " + id +                ", name = '" + name + '\'' +                ", password = '" + password + '\'' +                ", createdRooms = " + createdRooms +                ", activeRooms = " + activeRooms;    }}